import React from 'react';
import {Card, Button} from 'react-bootstrap';

const Item = (helado) => {
  [id, img, nombre, stock] = [helado.id(), helado.img(). helado.nombre(), helado.stock()];
  return <>
    <Card style={{ width: '18rem' }}>
        <Card.Img variant="top" src="helado.img" />
        <Card.Body>
            <Card.Title>{id}</Card.Title>
            <Card.Text> {stock ? 'En stock':'Sin stock'} </Card.Text>
            <Button variant="primary">Ver producto</Button>
        </Card.Body>
    </Card>
  </>;
};

export default Item;
